import Settings from "./Settings";

const Template = () => {
  return (
    <div className="flex-col justify-center items-start p-2">
      <div className="flex-col hover:bg-gray-200 bg-gray-500 rounded">
        <span>Personal Profile</span>
        <div>
        <textarea />
        </div>
        <Settings />
      </div>
    </div>
  );
};

export default Template;
